  makeTableHTML: function(myArray) {
    var result = "<table border=1>";
    for(var i=0; i<myArray.length; i++) {
        result += "<tr>";
        result += "<td>"+"hour "+(i+1)+"</td>";
        result += "<td>"+myArray[i] +" kWh"+"</td>";
        
    }
    result += "</table>";

    return result;
},

